import React from "react";

export const InfoTooltipContext = React.createContext();

export const infoTooltipCaptions = {
  success: {
    text: 'Вы успешно зарегистрировались!'
  },
  fail: {
    text: 'Что-то пошло не так!\n' +
      'Попробуйте ещё раз.'
  }
}
